$source-path: "../fonts/source-sans";

@font-face {
    font-family: 'source_sans';
    src: url('#{$source-path}/sourcesanspro-it-webfont.eot');
    src: url('#{$source-path}/sourcesanspro-it-webfont.eot?#iefix') format('embedded-opentype'),
    url('#{$source-path}/sourcesanspro-it-webfont.woff2') format('woff2'),
    url('#{$source-path}/sourcesanspro-it-webfont.woff') format('woff'),
    url('#{$source-path}/sourcesanspro-it-webfont.ttf') format('truetype'),
    url('#{$source-path}/sourcesanspro-it-webfont.svg#source_sans_proitalic') format('svg');
    font-weight: normal;
    font-style: italic;
}

@font-face {
    font-family: 'source_sans';
    src: url('#{$source-path}/sourcesanspro-bold-webfont.eot');
    src: url('#{$source-path}/sourcesanspro-bold-webfont.eot?#iefix') format('embedded-opentype'),
    url('#{$source-path}/sourcesanspro-bold-webfont.woff2') format('woff2'),
    url('#{$source-path}/sourcesanspro-bold-webfont.woff') format('woff'),
    url('#{$source-path}/sourcesanspro-bold-webfont.ttf') format('truetype'),
    url('#{$source-path}/sourcesanspro-bold-webfont.svg#source_sans_probold') format('svg');
    font-weight: bold;
    font-style: normal;

}

@font-face {
    font-family: 'source_sans';
    src: url('#{$source-path}/sourcesanspro-regular-webfont.eot');
    src: url('#{$source-path}/sourcesanspro-regular-webfont.eot?#iefix') format('embedded-opentype'),
    url('#{$source-path}/sourcesanspro-regular-webfont.woff2') format('woff2'),
    url('#{$source-path}/sourcesanspro-regular-webfont.woff') format('woff'),
    url('#{$source-path}/sourcesanspro-regular-webfont.ttf') format('truetype'),
    url('#{$source-path}/sourcesanspro-regular-webfont.svg#source_sans_proregular') format('svg');
    font-weight: normal;
    font-style: normal;
}

[bs-anim~="spin"] {
    animation: spin 1s infinite linear;
}

@keyframes spin {
    from {transform:rotate(0deg);}
    to {transform:rotate(360deg);}
}

html {
    overflow-x: hidden;
    overflow-y: auto;
    height: 100%;
    font: #{($base-font-size/16px)*100%}/#{$base-line-height} $base-font-family;
    -webkit-text-size-adjust: 100%;
    -ms-text-size-adjust: 100%;
    -webkit-font-smoothing: antialiased;

    @include media-query(min, $lap-start) {
        height: 100vh;
    }

}

body {
    min-height: 100%;
    max-width: 100%;
    overflow-x: hidden;
    overflow-y: auto;
    background: $white;
    color: $body-text;
    text-rendering: optimizeLegibility;

    @include media-query(min, $lap-start) {
        height: 100vh;
        overflow-y: hidden;
    }
}

main {
    position: relative;
    @include media-query(min, $lap-start) {
        overflow: hidden;
    }
}


// Lists

ul,
ol,
dl {
    ul,
    ol {
        margin-bottom: 0;
    }
}

ul,
ol {
    margin-left: $base-spacing;
}

ul {
    list-style: disc;

    ul {
        list-style: circle;
    }
}

ol {
    list-style: decimal;

    ol {
        list-style: lower-alpha;
    }
}

dt {
    font-weight: bold;
}

dd + dt {
    padding-top: $half-spacing;
}


// Tables

table {
    margin-top: $half-spacing;
    width: 100%;
}

th,
td {
    padding: $half-spacing/2 $half-spacing;
    border-bottom: 1px solid $grey-border;
    text-align: left;
    vertical-align: top;
}

th {
    font-weight: bold;
}

thead {
    tr:last-child {
        th {
            border-bottom: 2px solid $grey-border;
        }
    }
}

[colspan] {
    text-align: center;
}

[colspan="1"] {
    text-align: left;
}

[rowspan] {
    vertical-align: middle;
}

[rowspan="1"] {
    vertical-align: top;
}


