    margin-left: $half-spacing/2;
    @include font-size(20px);
    position: relative;
    top: 4px;

    &:hover, &:focus {
        color: $red;
    }
}

@import "../vars";
@import "../modules/mixins";

[bs-sidebar] {
    position: relative;

    @include sidebar-style;
    @include media-query(min, $lap-start) {
        width: $sidebar-width;

        &:after {
            content: " ";
            width: 10px;
            height: 100%;
            position: absolute;
            right: 0;
            top: 0;
            z-index: 10;
            background: linear-gradient(to right, rgba(0, 0, 0, 0) 0%,rgba(black, .20) 100%);
        }
    }
}

@import "../vars";
@import "../modules/mixins";

[bs-section-nav] {

    @include sidebar-style;

    position: absolute;
    width: 100%;
    transform: translateX(-200%) translateY(20px) scale(1.2);
    transition-timing-function: cubic-bezier(.3, 0, 0, 1.3);
    transition: all .3s;
    opacity: 0;
    z-index: 5;

    ul {
        margin-bottom: 0;
    }

    [bs-button] {

        text-transform: none;
        color: $grey-text;
        width: 100%;
        border-radius: 0;
        text-align: left;
        border: 0;
        position: relative;
        background: transparent;
        display: block;
        height: auto;
        padding: 11px 0 11px $icon-gutter;
        border-bottom: 1px solid $sidebar-hover;
        @include font-size(16px);
        margin-bottom: 0;
        box-shadow: 0 0 0 0;

        [bs-svg-icon] {
            top:    14px;
            width:  20px;
            height: 20px;
            @include svg-shadow(1px);
        }

        &.active {
            background: $sidebar-hover;
            z-index: 5;
            color: $white;

            [bs-svg-icon] {
                color: $red;
            }
        }

        &:hover {
            color: $white;
            background: $sidebar-hover;
        }
        &:active {
            color: $white;
            box-shadow: 0px 1px 2px 0 rgba(black, .1) inset;
            background: darken($sidebar-hover, 5%);
        }
    }

    @include media-query(min, $lap-start) {
        &.ready {
            opacity: 1;
        }
        position: relative;
        transform: translateX(0) translateY(0) scale(1);
    }

    &.active {
        transform: translateX(0) translateY(0) scale(1);
        opacity: 1;
    }
}

@import "../vars";
@import "../modules/mixins";

[bs-container] {
    @include media-query(min, $lap-start) {
        display: flex;
    }
}

[bs-content] {

    overflow-x: hidden;
    height: auto;
    position: relative;
    background: $white;
    width:      100%;

    @include media-query(min, $lap-start) {
        height: 100vh;
        overflow-y: auto;
        -webkit-overflow-scrolling: touch;
        padding-bottom: 59px; // offset header from scroll
        margin-top: 1px;
        width: auto;
        flex: 1;
    }
}

svg {

    width: 100%;
    height: 100%;
    opacity: 1;
    fill: currentColor!important;
    transition: .3s;

    &.icon-hidden {
        opacity: 0;

    }
}

.icon {
    display: inline-block;
}

.icon-trash {
    width: 100%;
    max-width: 26px;
    height: 26px;
}

.icon-word {

    width: 100%;
    max-width: 150px;
    height: 100%;
    margin-left: $gutter - 5px;
    color: $white;

    svg {
        position: relative;
        top: -1px;
    }
}

.icon-logo {

    color: $white;
    transition: all .1s;
    width: $icon-gutter;
    height: 37px;
    text-align: center;

    &:hover {
        color: $white;
        transform: scale(1.1);
    }
}

[bs-svg-icon] {
    display: inline-block;
    width:  $base-spacing;
    height: $base-spacing;
    line-height: inherit;
    position: relative;
    top: $half-spacing/2;
    use {
        width:  $base-spacing;
        height: $base-spacing;
    }
}

@import "../vars";
@import "../modules/mixins";

//
// Site Theme
//
h1, h2, h3, h4, h5, h6, hgroup,
p, blockquote, address,
ul, ol, dl,
table,
fieldset, figure, figcaption, details,
pre {
    margin-bottom: $half-spacing;
}

h1, .h1,
h2, .h2,
h3, .h3,
h4, .h4,
h5, .h5,
h6, .h6 {
    color: $hn-color;
    font-weight: $hn-font-weight;
    line-height: $hn-line-height;
    font-family: $hn-font-family;
    margin-bottom: $base-spacing;
    -webkit-font-smoothing: antialiased;

    small {
        font-size: inherit;
        font-weight: normal;
    }
}

h1, .h1 {
    @include font-size($h1-size);
}
h2, .h2 {
    padding-top: $half-spacing;
    @include font-size($h2-size);
}
h3, .h3 {
    @include font-size($h3-size);
    //margin-bottom: $half-spacing;
    font-weight: bold;
}
h4, .h4 {
    @include font-size($h4-size);
}
h5, .h5 {
    @include font-size($h5-size);
}
h6, .h6 {
    @include font-size($h6-size);
}

//
// Custom Heading styles
//
[bs-heading] {

    @include sidebar-style;
    @include font-size(24px);

    padding-left: $icon-gutter;
    position: relative;
    line-height: $nav-button-height;
    margin-top: 0;
    margin-bottom: 0;
    color: $grey-bg;
    background: darken($sidebar, 2%);
    border-top: 1px solid darken($sidebar, 2%);

    @include media-query(min, $lap-start) {

        @include font-size(38px);
        color: $sidebar;
        background: $grey-bg;
        padding-left: $icon-gutter + $gutter + 5px;
        border-top: 0;
        &:before {
            display: none;
        }
    }

    [bs-svg-icon] {

        position: absolute;
        left: 14px;
        top: $half-spacing - 3px;

        @include media-query(min, $lap-start) {
            height: 38px;
            width: 38px;
            top: $half-spacing/2 - 1px;
        }
    }
}

.lede {
    // margin-bottom: $base-spacing;
    @include font-size($lede-size);
}

.small {
    @include font-size($small-size);
}

a {
    color: $link;
    transition: background 0.3s ease, color 0.3s ease;

    &:hover,
    &:active,
    &:focus{
//        text-decoration:underline;
        color: $link-hover;
    }

    [class^="icon-"],
    [class*=" icon-"] {
        text-decoration: none;
    }
}

[bs-icon] {
    transition: background 0.3s ease, color 0.3s ease;
}

.flush--bottom {
    margin-bottom: 0!important;
}

.text--cap {
    text-transform: capitalize;
}

.color--lime {
    color: $lime;
}

.hidden {
    display: none;
    &.active {
        display: block;
    }
}

%item-stack {
    margin-bottom: $half-spacing;
}

[bs-stack] {
    margin-bottom: $half-spacing;
}


span.sep {
    margin-left:  5px;
    margin-right: 5px;
}

@include media-query(min, $lap-start) {
