    [bs-width~="80"]  { width: 80%!important; }
    [bs-width~="70"]  { width: 70%!important; }
    [bs-width~="60"]  { width: 60%!important; }
    [bs-width~="50"]  { width: 50%!important; }
    [bs-width~="40"]  { width: 40%!important; }
    [bs-width~="30"]  { width: 30%!important; }
