@import "../vars";
@import "../modules/mixins";

//
// Default button styles
// <button bs-button>Click me!</button>
//
[bs-button] {

    @include font-size(16px);

    display: inline-block;
    border: 1px solid darken($red, 15%);
    padding: 7px $half-spacing*1.5;
    width: auto;
    vertical-align: middle;
    background: $red;
    color: $white;
    border-radius: $base-radius;
    text-align: center;
    cursor: pointer;
    outline: none;
    transition: color .2s, background .2s;
    text-transform: uppercase;
    letter-spacing: 1px;
    //box-shadow: 0 1px 1px 0 rgba(black, .2);
    margin-bottom: $half-spacing;
    height: 40px;
    -webkit-tap-highlight-color: rgba(0,0,0,0);

    &:hover {
        text-decoration: none;
        color: $white;
        background: darken($red, 10%);
    }

    &:focus {
        text-decoration: none;
        color: $white;
    }

    &:active {
        color: $white;
        box-shadow: 0px 1px 0px 0 rgba(black, .1) inset;
        text-shadow: 1px 1px 0px rgba(black, .4);
    }

    &.success {

        [bs-state~="success"] {
            opacity: 1;
        }

        [bs-state~="default"] {
            opacity: 0;
        }

        color: $lime!important;
    }

    &[disabled] {
        border-color: desaturate($red, 30%);
        background: desaturate($red, 30%);
        color: #F2AAAA;
    }

    + .button,
    + a {
    }

    [bs-svg-icon] {
        position: absolute;
        top: 11px;
        left: $half-spacing;
        width: 16px;
        height: 16px;
    }
}

//
//
//
[bs-button~="subtle"] {
    @include subtle-button($red, $red-alt);
}

//
//
//
[bs-button~="subtle-alt"] {
    @include subtle-button(darken($grey-border, 40%), darken($grey-border, 20%));
}

//
//
//
[bs-button~="size-small"] {

    @include font-size(14px);
    padding: 5px $half-spacing;
    padding-top: 7px;
    height: 34px;

    [bs-svg-icon] {
        top: 9px;
        width: 14px;
        height: 14px;
    }
}


//
// Icon
//
[bs-button~="icon"] {

    padding-left: $half-spacing;
    padding-right: $half-spacing;

    [bs-svg-icon] {
        position: relative;
        top: 2px;
        left: auto;
    }
}

//
// Buttons with icons on left
//
[bs-button~="icon-left"] {

    position: relative;
    padding-left: $base-spacing + $half-spacing;

    [bs-svg-icon] {
        left: $half-spacing;
    }
}

//
// Buttons with icons on left
//
[bs-button~="icon-right"] {

    position: relative;
    padding-right: $base-spacing + $half-spacing;

    [bs-svg-icon] {
        left: auto;
        right: $half-spacing;
    }
}

//
//
//
[bs-button-group] {

    display: flex;
    align-items: stretch;
    margin-bottom: $half-spacing;

    [bs-button] {
        border-radius: 0;
        margin-bottom: 0;
        &:first-child {
            border-top-left-radius: 3px;
            border-bottom-left-radius: 3px;
        }
        &:last-child {
            border-top-right-radius: 3px;
            border-bottom-right-radius: 3px;
        }
    }
}

[bs-button~="inline"] {

    position: relative;
    background: transparent;
    color: $black;
    border-radius: 0;
    border: 0;
    text-transform: uppercase;
    box-shadow: 0 0 0 0;
    @include font-size(14px);
    margin-bottom: 0;
    padding-top: 10px;

    [bs-checkbox] {
        margin-right: 8px;
    }

    &:focus {
        background: transparent;
        color: $black;
    }

    &:hover {
        background: $grey-border;
        color: $black;
    }

    &:active {
        background: darken($grey-border, 10%);
        box-shadow: 0 0 0 0;
    }
}

[bs-button~="success"] {
    [bs-svg-icon] {
        color: $lime;
    }
}

[bs-button-row] {

    background: $grey-bg;
    border-bottom: 1px solid darken($grey-border, 10%);;

    @include media-query(min, $lap-start) {
        padding-left: $base-spacing;
    }
}

//
// Menu toggle
//
[bs-action~="menu-toggle"] {
    @include only-palm;
}

//
// Menu Close
//
[bs-action~="menu-close"] {
    @include only-palm;
}

@mixin inline-button {
    background: $grey-bg;
    color: $grey-text;
    text-shadow: 1px 1px 0 $white;
    height: 100%;
    padding: 0;
    padding-left: $half-spacing;
    padding-right: $half-spacing;
    border-radius: 0;
    line-height: $controls-height;
    text-transform: uppercase;
    @include font-size(14px);

    border-left: 1px solid $grey-border;
    border-top: 1px solid $grey-border;
    border-bottom: 0;

    @include media-query(min, $lap-start) {
    }

    &:hover {
        background: lighten($grey-bg, 2%);
        box-shadow: 0 0 1px rgba(black, .1) inset;
    }

    &:active {
        box-shadow: 0 0 3px rgba(black, .2) inset;
    }
}

$input-height: 40px;

@mixin base-input {

    outline: none;
    vertical-align: middle;
    border-radius: $base-radius;
    outline: 0;
    height: $input-height;
    padding-left: $half-spacing/2;
    padding-right: $half-spacing;
    max-width: 100%;
    font-family: $sans;
    color: $black;
}

/*
 * Basic Inputs
 */
button,
input,
select {
    @include base-input;
}

[bs-code-input] {
    width: 100%;
    border: 0;
    border: 1px dashed $grey-border;
    font-family: monospace;
    padding: $half-spacing;

    &:focus {
        color: $blue;
    }
}

[bs-heading-bar] {
    display: flex;
    margin-bottom: $half-spacing/2;
    [bs-input-label] {
        line-height: 36px;
    }
    [bs-button-group] {
        flex: 1;
        justify-content: flex-end;
        margin-bottom: auto;
        margin-top: auto;

        [bs-button] {
            padding: 3px 5px;
            height: 24px;
            font-size: 10px;

            @include media-query(min, $lap-start) {
                padding: 7px $half-spacing;
                height: 34px;
                font-size: 14px;
            }
        }
    }
}

[bs-textarea-input] {
    position: relative;
    margin-bottom: $half-spacing;
    [bs-tag] {
        left: -64px;
        color: #D08989;
    }
}
[bs-error~="offset"] {
    position: absolute;
    top: 0;
    left: 0;
}

[bs-input-label] {

    @include font-size(14px);

    position: relative;
    display: block;
    text-transform: uppercase;
    font-weight: bold;
    color: $grey-text;
    letter-spacing: .5px;

    @include media-query(min, $lap-start) {
        @include font-size(14px);
    }
}

[bs-label-heading] {
    color: $black;
    font-weight: bold;
}

[bs-input] {

    padding: 0;
    border-radius: $base-radius;
    height: 100%;

    > * {
        margin-top: auto;
        margin-bottom: auto;
    }

    input {

        border: 0;
        border-radius: 0;
        padding: 0;
        outline: 0;
        @include font-size(16px);
        border-bottom: 1px dashed $grey-border;

        &:focus {
            color: $blue;
        }
    }

    input[type=text] {
        width: 100%;
    }
    input[type=radio] {
        &:checked {
            + label {
                color: $blue!important;
            }
        }
    }
}

[bs-input~="text"] {
    height: auto;
    input {
        font-family: monospace;
    }
}

[bs-input~="checkbox"] {

}

[bs-input~="inline"] {

    display: flex;
    height: auto;

    input {
        &:focus {
            + label {
                text-decoration: underline;
            }
        }
    }

    > * {

        margin-top: auto;
        margin-bottom: auto;

        &:first-child {
            margin-right: $half-spacing;
        }
    }
}

$spinner-color: $grey;
.loader,
.loader:before,
.loader:after {
    background: $spinner-color;
    -webkit-animation: load1 .5s infinite ease-in-out;
    animation: load1 .5s infinite ease-in-out;
    width: 1em;
    height: 2em;
}
.loader:before,
.loader:after {
    position: absolute;
    top: 0;
    content: '';
}

.loader:before {
    left: -1.5em;
}

.loader {
    opacity: 1;
    transition: all 1s;
    text-indent: -9999em;
    margin: 8em auto;
    position: absolute;
    font-size: 11px;
    -webkit-animation-delay: -0.16s;
    animation-delay: -0.16s;
    z-index: 1;
    left: 50%;
    &.behind {
        z-index: 0;
    }
    &.ready {
        opacity: 0;
        transform: translateY(-200%);
    }
}
.loader:after {
    left: 1.5em;
    -webkit-animation-delay: -0.32s;
    animation-delay: -0.32s;
}

@keyframes load1 {
    0%,
    80%,
    100% {
        box-shadow: 0 0 $spinner-color;
        height: 4em;
    }
    40% {
        box-shadow: 0 -2em $spinner-color;
        height: 5em;
    }
}

@import "../vars";
@import "../modules/mixins";

@mixin panel {

    position: relative;

    [bs-text~="lede"] {
        @include font-size(20px);
        @include media-query(min, $lap-start) {
            @include font-size(24px);
        }
        position: relative;
        margin-bottom: 0;
        color: $black;
    }

    [bs-text~="prefixed"] {
        text-transform: none;
        span {
            text-transform: uppercase;
            color: $grey-border;
            font-weight: 200;
        }
    }
}

[bs-panel] {

    @include panel;

    background: $white;
    padding: $base-spacing 0 $half-spacing;
    border-bottom: 1px solid $grey-border;
}

[bs-panel~="switch"] {

    &.disabled {
        background: $grey-bg;
        &, [bs-text~="lede"] {
            color: $grey-text;
        }
    }

    [bs-panel-content] {

        padding-left: $base-spacing*3;

        @include media-query(min, $lap-start) {
            [bs-panel-icon] {
                top: $base-spacing + 6px;
            }
            padding-left: $base-spacing*4;
        }

        margin-bottom: $half-spacing;
    }

    [bs-panel-content~="basic"] {
        padding-left: $half-spacing;
        padding-right: $half-spacing;
        max-width: none;
    }

    [bs-panel-content~="tight"] {
        padding-left: 0;
        padding-right: 0;
        max-width: none;
    }
}

[bs-panel~="last"] {

    border-bottom: 2px solid $grey-border;
    position: relative;

    &:after {
        content: " ";
        width: 100%;
        height: 1px;
        display: block;
        background: $grey-border;
        position: absolute;
        bottom: -4px;
        z-index: 2;
    }
}

[bs-panel~="controls"] {
    padding: 0;
    background: $grey-bg;
    border-bottom: 1px solid $grey-border;

    @include media-query(min, $lap-start) {
        padding: $base-spacing;
        padding-bottom: $half-spacing;
    }

    [bs-heading] {
        @include media-query(min, $lap-start) {
            margin-bottom: $half-spacing;
        }
    }
}

[bs-panel~="no-border"] {
    border-bottom: 0;
}
[bs-panel~="outline"] {
    border-bottom: 1px solid $grey-border;
}

[bs-panel-icon] {

    position: absolute;
    left: $half-spacing;
    top: $base-spacing + 3px;

    [bs-svg-icon] {
        color: $sidebar;
        height: 24px;
        width: 24px;
        top: 0;
    }
}

[bs-panel-content] {

    padding-left: $base-spacing*2;
    padding-right: $half-spacing;

    @include media-query(min, $lap-start) {

        padding-left: $base-spacing*4;

        [bs-panel-icon] {
            left: 44px;
            top: $base-spacing;
            [bs-svg-icon] {
                height: 30px;
                width: 30px;
                use {
                    height: 30px;
                    width: 30px;
                }
            }
        }
    }

    [bs-panel~="trans"] & {
        padding-left: $base-spacing*2 + $half-spacing;
    }
}

[bs-panel-content~="basic"] {

    padding-left: $base-spacing;
    padding-right: $base-spacing;
    max-width: 50em;

    @include media-query(min, $lap-start) {
        padding-left: $base-spacing*1.5;
        padding-right: $base-spacing*1.5;
    }
}

[bs-skinny] {
    @include media-query(min, $wide-start) {
        padding: $base-spacing*2 ($base-spacing*3 + $half-spacing);
    }
}

$controls-height: 41px;

[bs-flush] {
    margin-bottom: 0;
    border-bottom: 0;

}

//
// Generic lists
//
[bs-list] {

    margin-left: 0;
    list-style: none;
    word-wrap: break-word;

    p {
        margin-bottom: 0;
    }

    [bs-button-group] {

        justify-content: flex-end;
        margin-bottom: 0;

        [bs-button] {
            height: auto;
            border: 0;
            box-shadow: 0 0 0 0;
            border-radius: 0;
            &:active {
                box-shadow: 0px 0px 1px rgba(black, .3) inset;
            }
            &:last-child {
            }
        }
    }
}

[bs-list~="inline"] {
    li {
        display: inline-block;
    }
}

//
// Bordered lists
//
[bs-list~="bordered"] {

    > li {

        padding: ($half-spacing - 3px) $half-spacing;
        border-bottom: 1px solid $grey-border;

        &:first-child {
            border-top: 1px solid $grey-border;
        }
    }
}

//
// In-list controls
//
[bs-list~="inline-controls"] {

    word-wrap: break-word;

    p {
        margin-bottom: $half-spacing/2;
    }

    li {

        background: $white;
        position: relative;
        padding-left: $half-spacing;
        transition: background .5s;

        &:hover {

            background: $grey-bg;

            [bs-button~="subtle-alt"] {
                color: $black;
            }

            [bs-button] {
                background: transparent;
                &:hover {
                    color: $red;
                }
            }
        }

        // On wide screens, allow inline-buttons to sit on same line.
        @include media-query(min, $desk-start) {

            padding: 0;
            padding-left: $half-spacing;
            display: flex;

            p {
                margin-bottom: 0;
                flex: 1;
                padding-top: 11px;
                padding-bottom: 11px;
            }
        }
    }

    [bs-button-group] {

        margin-bottom: 0;

        [bs-button~="icon-left"] {

            line-height: 35px;

            [bs-svg-icon] {
                top: 12px;
            }
        }

        [bs-svg-icon] {
            top: 4px;
            width:  22px;
            height: 22px;
        }
    }
}

[bs-tag] {
    position: absolute;
    right: calc(100% + 10px);
    text-transform: uppercase;
    font-size: 10px;
    background: #f1f1f1;
    border-radius: 3px;
    padding: 1px 3px;
    top: 6px;
    text-align: center;

    span {
        color: darken(#f1f1f1, 20%);
        display: block;
    }
}

[bs-tag~="offset"] {
    top: 44px;
    @include media-query(min, $lap-start) {
        top: 6px;
        right: auto;
        left: -86px;
    }
}

//
// Padded-left variant of the bs-list
//
[bs-list~="padded-left"] {
    li {
        padding-left: $half-spacing;
    }
}

//
// Basic version of a list
//
[bs-list~="basic"] {
    list-style: circle;
    margin-left: $base-spacing;
}

//
// Offset thing
//
[bs-offset~="basic"] {

    > li {

        padding-left: $base-spacing;

        @include media-query(min, $lap-start) {
            padding-left: $base-spacing*1.5;
        }
    }
}

@import "../vars";
@import "../modules/mixins";

[bs-controls] {
    width: auto;
    flex: 1;
}

[bs-controls~="top"] {
//    width: 100%;
//    position: fixed;
//    bottom: 0;
//    z-index: 200;
//    @include media-query(min, $lap-start) {
//    }
}

[bs-flex~="top"] {

    display: flex;
    background: lighten($header, 4%);
    border-bottom: 1px solid lighten($grey, 6%);

    @include media-query(min, $lap-start) {
        justify-content: flex-end;
        height: $header-height - 1px;
    }
}

[bs-control] {

    @include font-size(12px);

    flex: 1;

    @include media-query(min, $lap-start) {
        flex: none;
        height: 100%;
        padding-top: $half-spacing/2 + 3px;
        padding-left: $half-spacing;
        padding-right: $half-spacing;
    }

    padding-left: $half-spacing/2;
    padding-right: $half-spacing/2;
    border-left: 1px solid $grey;
    border-top:  1px solid $grey;
    position: relative;
    color: $grey-text;
    text-transform: uppercase;
    text-align: center;
    padding-top: 10px;
    padding-bottom: 6px;

    &:first-child {
        border-left-width: 0;
        @include media-query(min, $lap-start) {
            border-left-width: 1px;
        }
    }

    [bs-svg-icon] {
        transition: all .3s;
        width: 14px;
        height: 14px;
        top: 0;
        display: block;
        margin-left: auto;
        margin-right: auto;
        margin-bottom: 5px;

        @include media-query(min, $lap-start) {
            width: 19px;
            height: 19px;
        }
    }

//    &:before {
//        width: 1px;
//        height: 100%;
//        top: 0;
//        position: absolute;
//        left: -2px;
//        content: " ";
//        background: lighten($grey, 10%);
//    }

    &:focus {
        text-decoration: none;
        color: $grey-text;
    }

    &:hover {

        background: $sidebar;
        text-decoration: none;
        color: $white;

        [bs-svg-icon] {
            transform: rotate(360deg) scale(1.1);
            color: $white;
        }
    }
}

[bs-state~="success"] {
    opacity: 0;
    color: $lime;
}

[bs-state~="waiting"] {
    opacity: 0;
    color: $blue;
}

[bs-state-icons] {

    position: relative;

    [bs-svg-icon] {
        position: absolute;
    }
}

[bs-anim~="spin"] {
    animation: spin 1s infinite linear;
}

[bs-state-wrapper] {

    display: flex;

    [bs-state~="inline"] {
        top: 3px;
        left: $half-spacing;
        width: 17px;
        height: 27px;
    }

    &.waiting {
        [bs-state~="waiting"] {
            opacity: 1;
        }
    }
    &.success {
        [bs-state~="success"] {
            opacity: 1;
        }
    }
}

$switch-size: 22px;

.cmn-toggle {
    position: absolute;
    margin-left: -9999px;
    visibility: hidden;
}
.cmn-toggle + label {
    display: block;
    position: relative;
    cursor: pointer;
    outline: none;
    user-select: none;
    background: #AAAAAA;
}
input.cmn-toggle-round + label {
    padding: 4px;
    width: $switch-size*2;
    height: $switch-size;
    border-radius: $base-radius;
}
input.cmn-toggle-round + label:before, input.cmn-toggle-round + label:after {
    display: block;
    position: absolute;
    top: 1px;
    left: 2px;
    bottom: 1px;
    content: "";
}
input.cmn-toggle-round + label:before {
    right: 2px;
    background-color: #AAAAAA;
    border-radius: $base-radius;
    transition: background 0.2s;
}
input.cmn-toggle-round + label:after {
    top: 3px;
    width: $switch-size - 6px;
    height: $switch-size - 6px;
    background-color: $white;
    border-radius: $base-radius;
    transition: margin 0.2s;
}
input.cmn-toggle-round:checked + label:before {
    background-color: $lime;
}

input.cmn-toggle-round + label:after {
    margin-left: 1px;
}

input.cmn-toggle-round:checked + label:after {
    margin-left: $switch-size + 1px;
}

input.cmn-toggle-round:checked + label {
    background-color: $lime;

}

$footer-text: $black;

[bs-footer] {

    color: $footer-text;
    text-align: center;
    margin-bottom: $base-spacing;
    padding-top: $base-spacing;

    @include font-size(14px);

    @include media-query(min, $lap-start) {
//        text-shadow: 1px 1px 1px rgba(black, .4);
        padding-top: $base-spacing;
        position: fixed;
        bottom: 0;
        width: $sidebar-width;
        color: $grey-text;
    }

    p {
        margin-bottom: 0;
    }

    a {
        color: $footer-text;
        @include media-query(min, $lap-start) {
            color: $grey-text;
        }

        &:hover, &:focus {
            text-decoration: none;
            color: lighten($grey-text, 10%);
        }
    }

    [bs-icon] {
        padding: 0 10px;
    }

    [bs-svg-icon] {
        @include media-query(min, $lap-start) {
            @include svg-shadow;
        }
        width: 20px;
        height: 20px;
    }
}

@import "../vars";
@import "../modules/mixins";

pre {
    margin-top: $half-spacing;
    padding: $half-spacing;
    border-radius: $base-radius;
    box-shadow: -10px 0px 10px $grey-border inset;
    border: 1px solid darken($grey-border, 2%);

    code {
        @include font-size(12px);
        @include font-size(16px);
        color: currentColor;
        line-height: 1;
        background: transparent;
        border: 0;
    }
}

code {
    background: $grey-bg;
    display: inline-block;
    padding: 0 5px;
    border: 1px solid $grey-border;
    color: darken($blue, 10%);
    @include font-size(14px);
}

[bs-notify] {

    position: absolute;
    left: 0;
    width: 100%;
    background: $sidebar;
    color: $white;
    text-align: center;
    padding: $base-spacing $half-spacing;
    box-shadow: 0 5px 5px 0px rgba(0, 0, 0, .2);
    transform: translateY(-200%);
    transition: all .3s;
    z-index: 100;

    &.active {
        transform: translateY(0);
    }

    p {
        margin-bottom: 0;
    }

    &.success {

    }

    &.error {
        background: #ED6A13;
    }
}

@mixin cover-all {
    position: absolute;
    width: 100%;
    height: 100%;
    top: 0;
    left: 0;
    right: 0;
}

[bs-overlay] {

    @include cover-all;
    background: rgba(black, .9);
    padding: $base-spacing*2 $half-spacing;
    color: $white;
    text-align: center;
    visibility: hidden;
    z-index: 2000;

    &.active {
        visibility: visible;
    }

    * {
        color: $white;
    }

    [bs-svg-icon] {
        width: 40px;
        height: 40px;
        @include media-query(min, $lap-start) {
            width: 100px;
            height: 100px;
        }
    }
}
